   <script>
 document.addEventListener("DOMContentLoaded", function() {
      const bookContainer = document.getElementById("book-container");
      const pages = document.getElementsByClassName("book-page");
      const numPages = <?php echo $numPages; ?>;
      let currentPage = 1;
      let zoomed = false;
      const loupe = document.querySelector(".loupe");
      const zoomBtn = document.querySelector(".zoom-btn");

      const options = {
        width: 1200, // Ajuster la largeur du livre en pixels
        height: 900, // Ajuster la hauteur du livre en pixels
        autoCenter: true,
        auto: false, // Désactiver le défilement automatique
      };

      const flipbook = $("#book-container").turn(options);

      // Activer l'effet scissor pour un tournage de pages réaliste
      flipbook.turn("peel", "tr");

      // Fonction pour appliquer l'effet de déformation 3D
      function apply3DTransformation(page) {
        // ... Votre code 3D ...
      }

      // Appliquer l'effet de déformation 3D lors du chargement de la première page
      apply3DTransformation(currentPage);

      // Gérer le clic sur les flèches pour changer de page
      document.getElementById("prev-page").addEventListener("click", () => {
        if (currentPage > 1) {
          flipbook.turn("previous");
          apply3DTransformation(currentPage - 1);
          zoomed = false; // Réinitialiser le zoom en changeant de page
          zoomBtn.style.display = "none"; // Masquer le bouton de zoom lors du changement de page
          loupe.style.display = "none"; // Masquer la loupe lors du changement de page
        }
      });

      document.getElementById("next-page").addEventListener("click", () => {
        if (currentPage < numPages) {
          flipbook.turn("next");
          apply3DTransformation(currentPage + 1);
          zoomed = false; // Réinitialiser le zoom en changeant de page
          zoomBtn.style.display = "none"; // Masquer le bouton de zoom lors du changement de page
          loupe.style.display = "none"; // Masquer la loupe lors du changement de page
        }
      });

      // Gérer les touches du clavier pour changer de page
      document.addEventListener("keydown", (event) => {
        switch (event.key) {
          case "ArrowLeft":
            if (currentPage > 1) {
              flipbook.turn("previous");
              apply3DTransformation(currentPage - 1);
              zoomed = false; // Réinitialiser le zoom en changeant de page
              zoomBtn.style.display = "none"; // Masquer le bouton de zoom lors du changement de page
              loupe.style.display = "none"; // Masquer la loupe lors du changement de page
            }
            break;
          case "ArrowRight":
            if (currentPage < numPages) {
              flipbook.turn("next");
              apply3DTransformation(currentPage + 1);
              zoomed = false; // Réinitialiser le zoom en changeant de page
              zoomBtn.style.display = "none"; // Masquer le bouton de zoom lors du changement de page
              loupe.style.display = "none"; // Masquer la loupe lors du changement de page
            }
            break;
          default:
            break;
        }
      });

      // Gérer l'événement de changement de page pour mettre à jour la page courante
      flipbook.bind("turned", (event, page, view) => {
        currentPage = page;
      });

      // Fonction pour afficher la loupe avec le bouton de zoom
      function showLoupe(event) {
        const imgRect = event.target.getBoundingClientRect();
        const x = (event.clientX - imgRect.left + bookContainer.scrollLeft) * (event.target.naturalWidth / imgRect.width);
        const y = (event.clientY - imgRect.top + bookContainer.scrollTop) * (event.target.naturalHeight / imgRect.height);

        const bgPosX = -(x-60);
        const bgPosY = -(y-60);

        loupe.style.backgroundImage = `url(${event.target.src})`;
        loupe.style.display = "block";

        // Ajuster la position de la loupe pour centrer le zoom sur la souris
        const loupeX = event.pageX - loupe.offsetWidth / 2;
        const loupeY = event.pageY - loupe.offsetHeight / 2;
        loupe.style.left = `${loupeX}px`;
        loupe.style.top = `${loupeY}px`;

        loupe.style.backgroundPosition = `${bgPosX}px ${bgPosY}px`;

        // Afficher le bouton de zoom uniquement si la page n'est pas déjà agrandie
        if (!zoomed) {
          zoomBtn.style.display = "block";
          zoomBtn.innerText = "+";
        } else {
          zoomBtn.innerText = "-";
        }
      }

      // Gérer le survol du conteneur du livre pour désactiver la loupe
bookContainer.addEventListener("mouseleave", () => {
  loupe.style.display = "none"; // Masquer la loupe lorsque le curseur quitte le conteneur du livre
});


      let loupeActive = false; // Variable pour suivre l'état de la loupe

// Gérer le clic sur l'image "binks.png" pour activer/désactiver la loupe
document.getElementById("binks-img").addEventListener("click", () => {
  if (loupeActive) {
    // Si la loupe est déjà active, désactiver la loupe
    unzoomPage();
    loupeActive = false;
  } else {
    // Si la loupe n'est pas active, activer la loupe
    loupeActive = true;
  }
});

// Gérer le survol de la page pour afficher la loupe avec le bouton de zoom
bookContainer.addEventListener("mousemove", (event) => {
  if (loupeActive) {
    showLoupe(event);
  }
});

// Gérer le clic sur la loupe pour zoomer ou dézoomer
loupe.addEventListener("click", () => {
  if (loupeActive) {
    if (!zoomed) {
      // Agrandir la page
      zoomPage();
    } else {
      // Réduire la page
      unzoomPage();
    }
  }
});


      // Fonction pour agrandir la page
      function zoomPage() {
        zoomed = true;
        const currentPageElement = pages[currentPage - 1];
        currentPageElement.classList.add("zoomed");
        zoomBtn.innerText = "-";
      }

      // Fonction pour réduire la page
      function unzoomPage() {
        zoomed = false;
        const currentPageElement = pages[currentPage - 1];
        currentPageElement.classList.remove("zoomed");
        zoomBtn.innerText = "+";
      }
    });
  
    </script>

</body>
</html>

